private float getAbsoluteActivatedChildQueueCapacity(String nodeLabel) {
  try {
    readLock.lock();
    Float totalActivatedCapacity = getByLabel(nodeLabel);
    if (totalActivatedCapacity != null) {
      return totalActivatedCapacity;
    } else{
      return 0;
    }
  } finally {
    readLock.unlock();
  }
}
